import React, { useEffect, useState } from 'react';

const Services = () => {
    const [services, setServices] = useState([])
    useEffect(() => {
        fetch('./tools.json')
            .then(res => res.json())
            .then(data => setServices(data));
    },[])
    return (
        <div className="service-container">
            <h2>this is services</h2>
            {services.length}
        </div>
    );
};

export default Services;
